import React from 'react';
import ReactDOM from 'react-dom';
import './style.css';

function App() {
    let tod = new Date();
    let hour = tod.getHours();
    let min = tod.getMinutes();
    let sec = tod.getSeconds();
    let printstat;

    if(hour > 0 && hour < 12)
        printstat = "Morning Dude";
    else if(hour >= 12 && hour < 17)
        printstat = "Noon bro";
    else if(hour >= 17 && hour < 19)
        printstat = "Evening Fella";
    else 
        printstat = "Night night!";
    if(min < 10) 
        min = "0" + min;

    let showtime = hour+":" + min+ + sec;
    return(showtime);
}



ReactDOM.render(<App />, document.getElementById('root'));
